(25, '06232317-e900-410d-a3ab-3acf1c26c85f', '- электронный блок (1 шт.);\r\n- манжета (1 шт.);\r\n- комплект элементов питания ( 4шт. батарейки АА);\r\n- футляр для хранения прибора (1 шт.);\r\n- инструкция по эксплуатации (1 шт.);\r\n- гарантийный талон (1 шт.);\r\n- упаковка (1 шт.)\r\n \r\n '),
(25, '5407fb9f-84d0-4e30-ad58-e042b137d7e4', 'Прибор автоматический электронный для измерения артериального давления и частоты пульса Tensoval® duo control / Тенсовал дуо контрол\r\nTensoval® duo control - двойной контроль Вашего давления!\r\nTensoval® duo control - это современный аппарат для измерения артериального давления на плече, работа которого основана на инновационной технологии Duo Sensor, сочетающей в себе два метода измерения артериального давления - осциллометрический и аускультативный (метод Короткова). Это позволяет производить достоверное измерение артериального давления, как при артериальной гипертонии, так и при различных видах нарушений сердечного ритма, включая мерцательную аритмию. Индивидуальный подход к накачиванию манжеты в каждом случае измерения (технология Comfort Air), распознавание нарушений сердечного ритма (индикатор аритмии), новая комфортная запатентованная манжета.\r\nВ то время как большинство автоматических приборов для измерения артериального давления работает только с использованием осциллометрической технологии, Duo Sensor Technology работает в первую очередь по очень точному методу Короткова. И только в исключительных случаях прибор показывает результаты осциллометрического измерения.\r\nИзмерение по методу Короткова отличается высокой точностью и хорошей устойчивостью к помехам. С его помощью достигаются точные показатели измерения также и у пациентов с различными видами нарушений cердечного ритма. Поэтому врачи обычно пользуются этим методом, прослушивая стетоскопом, так называемые тона Короткова и таким образом определяя артериальное давление.\r\nТехнология Comfort Air\r\nТехнология Comfort Air во время накачивания манжеты автоматически определяет систолическое(верхнее) значение артериального давления и устанавливает по нему давление накачивания манжеты, добавляя к этому значению 30мм рт.ст. Благодаря этому обеспечивается более комфортное измерение артериального давления на плече.\r\nТехнические характеристики:\r\nМетод измерения аускультативный (метод Короткова) и осциллометрический\r\nИспользуемые технологии Duo Sensor, Comfort Air, Fuzzy Logic, синхронизация с пульсом\r\nДиапазон измерений систола (SYS): 50 - 250 мм рт. ст.\r\nдиастола (DIA): 40 - 160 мм рт. ст.\r\nпульс (PULSE): 40 - 160 ударов в минуту\r\nВысокая точность измерения подтверждена BHS A/A - Британским обществом по борьбе с гипертензией\r\nГерманским объединением по борьбе с гипертензией\r\nESH, AAMI, DIN EN 1060-4, СИ и др.\r\nИсточник питания 4 х 1,5 V Mignon щелочные батарейки (AA / LR06) или\r\nсетевой адаптер HARTMANN Tensoval (опционально)\r\nАвтоматическое отключение через 3 минуты после окончания измерения\r\nЕмкость элементов питания > 1400 измерений\r\nМанжета стандартная манжета 32-42 см\r\nЕмкость памяти 2 х 60 измерений, средние значения по рекомендациям ВОЗ, дата и время; «гостевой» режим измерения\r\nГарантийный срок электронный блок - 5 лет\r\nманжета - 3 года\r\n \r\n '),
(25, 'e05c5659-2a4e-4bed-8baa-951ca061a93e', '\n__IMAGE_EXISTS__'),
(25, 'd5188c17-29d0-45f7-851b-bdb7a135dd8b', 'HARTMANN'),
(27, 'd5188c17-29d0-45f7-851b-bdb7a135dd8b', 'test'),
(25, 'bd7f1460-a435-49f0-93f2-8f5c65bad069', ' \r\n \r\nМногочисленные факторы, такие как физическое напряжение, прием медикаментов или время суток, могут оказывать влияние на артериальное давление. Поэтому артериальное давление следует всегда измерять в одно и то же время суток при аналогичных условиях.\r\nДо начала измерения выдержите паузу как минимум 5 минут. Даже работа за письменным столом повышает систолическое артериальное давление примерно на 6 мм рт. ст., а диастолическое - на 5 мм рт. ст.\r\nНе пейте кофе и не курите в течение часа перед измерением.\r\nНе измеряйте давление при сильном позыве к мочеиспусканию. Полный мочевой пузырь может привести к повышению артериального давления примерно на 10 мм\r\nрт.ст.\r\nИзмерение следует проводить на свободной от одежды руке, сидя в вертикальном положении.\r\nПри использовании тонометра с манжетой на запястье, во время измерения необходимо, чтобы манжета располагалась на уровне сердца. При использовании тонометра с манжетой на плечо манжета автоматически находится на правильном уровне.\r\nВо время измерения нельзя двигаться и говорить.\r\nРазговор повышает давление на 6 -7 мм рт. ст.\r\nМежду двумя измерениями необходимо выдержать паузу не менее одной минуты для того, чтобы уменьшить давление на сосуды и подготовить их к очередному измерению.\r\nМежду двумя измерениями необходимо выдержать паузу не менее одной минуты для того, чтобы уменьшить давление на сосуды и подготовить их к очередному измерению.\r\n\r\n '),
(26, '06232317-e900-410d-a3ab-3acf1c26c85f', '- электронный блок (1 шт.);\r\n- манжета (1 шт.);\r\n- комплект элементов питания ( 4шт. батарейки АА);\r\n- футляр для хранения прибора (1 шт.);\r\n- инструкция по эксплуатации (1 шт.);\r\n- гарантийный талон (1 шт.);\r\n- упаковка (1 шт.)\r\n \r\n \r\n '),
