ерения аускультативный (метод Короткова) и осциллометрический\r\nИспользуемые технологии Duo Sensor, Comfort Air, Fuzzy Logic, синхронизация с пульсом\r\nДиапазон измерений систола (SYS): 50 - 250 мм рт. ст.\r\nдиастола (DIA): 40 - 160 мм рт. ст.\r\nпульс (PULSE): 40 - 160 ударов в минуту\r\nВысокая точность измерения подтверждена BHS A/A - Британским обществом по борьбе с гипертензией\r\nГерманским объединением по борьбе с гипертензией\r\nESH, AAMI, DIN EN 1060-4, СИ и др.\r\nИсточник питания 4 х 1,5 V Mignon щелочные батарейки (AA / LR06) или\r\nсетевой адаптер HARTMANN Tensoval (опционально)\r\nАвтоматическое отключение через 3 минуты после окончания измерения\r\nЕмкость элементов питания > 1400 измерений\r\nМанжета стандартная манжета 32-42 см\r\nЕмкость памяти 2 х 60 измерений, средние значения по рекомендациям ВОЗ, дата и время; «гостевой» режим измерения\r\nГарантийный срок электронный блок - 5 лет\r\nманжета - 3 года\r\n \r\n \r\n '),
